CAML.ViewQuery(
    CAML.Where(
        CAML.And(
            CAML.Eq(CAML.FieldValue("Project", "Integer", "{0}")),
            CAML.Geq(CAML.FieldValue("StartDate","DateTime", CAML.Today()))
        )
    ),
    CAML.OrderBy(
        new OrderByField("StartDate", false),
        new OrderByField("Title")
    ),
    rowLimit: 5
);

